package com.ifi.tp;

import com.ifi.tp.bo.Pokemon;
import com.ifi.tp.bo.Product;
import com.ifi.tp.bo.ProductType;
import com.ifi.tp.bo.Trainer;
import com.ifi.tp.repository.TrainerRepository;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import org.springframework.context.annotation.Bean;

import java.util.List;

@SpringBootApplication
public class TrainerApi {

    public static void main(String... args){
        SpringApplication.run(TrainerApi.class, args);
    }

    @Bean
    @Autowired
    public CommandLineRunner demo(
            TrainerRepository repository) {
        return (args) -> {

            var ash = new Trainer();
            ash.setName("Ash");
            ash.setPicture(" data:image/png;base64,");
            ash.setMoney(15000);

            var pikachu = new Pokemon();
            pikachu.setPokemonNumber(25);
            pikachu.setLevel(18);
            pikachu.setHp(53);

            var dodrio = new Pokemon();
            dodrio.setPokemonNumber(85);
            dodrio.setLevel(15);
            dodrio.setHp(49);

            ash.setTeam(List.of(pikachu, dodrio));

            var potion = new Product();
            potion.setProductId(1);
            potion.setQuantity(15);

            var pokeball = new Product();
            pokeball.setProductId(2);
            pokeball.setQuantity(7);

            ash.setInventory(List.of(potion, pokeball));

            // Pierre

            var pierre = new Trainer();
            pierre.setName("Pierre");
            pierre.setPicture(" data:image/png;base64,");
            pierre.setMoney(78000);

            var squirtle = new Pokemon();
            squirtle.setPokemonNumber(7);
            squirtle.setLevel(17);
            squirtle.setHp(49);

            var venomoth = new Pokemon();
            venomoth.setPokemonNumber(49);
            venomoth.setLevel(25);
            venomoth.setHp(80);

            pierre.setTeam(List.of(squirtle, venomoth));

            potion = new Product();
            potion.setProductId(1);
            potion.setQuantity(5);

            pokeball = new Product();
            pokeball.setProductId(2);
            pokeball.setQuantity(5);

            pierre.setInventory(List.of(potion, pokeball));


            var misty = new Trainer();
            misty.setName("Misty");
            misty.setPicture(" data:image/png;base64,");
            misty.setMoney(80000);

            var staryu = new Pokemon();
            staryu.setPokemonNumber(120);
            staryu.setLevel(18);
            staryu.setHp(30);
            var starmie = new Pokemon();
            starmie.setPokemonNumber(121);
            starmie.setLevel(21);
            starmie.setHp(66);

            misty.setTeam(List.of(staryu, starmie));

            // save a couple of trainers
            repository.save(ash);
            repository.save(misty);
            repository.save(pierre);
        };
    }

}
